import React from 'react';
import { Footer } from 'react-materialize';

function AppFooter() {
  return (
    <Footer
      className="example"
      moreLinks={<a className="grey-text text-lighten-4 right" href="/">More Links</a>}
    >
      <h5 className="white-text">
        Footer Content
      </h5>
    </Footer>
  );
}




export default AppFooter;
